import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import Grid from '@material-ui/core/Grid';
import logo from '../images/logo.png'


export default function App () {

    return (
        <AppBar color="primary" positionsticky="true" >
        <Toolbar>
            <IconButton edge="start" color="inherit" aria-label="menu">
            </IconButton>

            <div align="center">
                <img src={logo} alt="Website Logo" width="75%"/>

            <Grid container direction="row" justify="space-evenly" alignItems="center">
                <Button color="grey" font-size="40px">Projects</Button>
                <Button color="inherit" >Experience</Button>
                <Button color="inherit" >Education</Button>
                <Button color="inherit" >About</Button>
                <Button color="inherit" >Contact</Button>
            </Grid>
            </div>

        </Toolbar>
        </AppBar>

    //     <div className={classes.root}>
    //     <br/><br/>
    //     <CssBaseline />
    //     <AppBar color="transparent" positionsticky="true">
    //       <Toolbar>
    //         <div className={classes.title}>
    //           <Link to="/" variant="h5" color="inherit">
    //             <img src={logo} alt="CBA" className={classes.logo}/>
    //           </Link>
    //         </div>
    //       </Toolbar>
    //     </AppBar>

    //   </div>
    )
}
